void mainImage(out vec4 fragColor, in vec2 fragCoord)
{
    vec2 n, q, p = (fragCoord - iResolution.xy * 0.5) / iResolution.y;
    float d = dot(p, p), S = sin(iTime*2.)*6., a = -0.12, j = 0.2;

    for (float i = 0.0; i < 10.0; i++) {
        mat2 m = mat2(cos(5.0), -sin(5.0), sin(5.0), cos(5.0));
        p *= m; n *= m;
        q = p*S + d*14.0 + sin(d - iTime*13.0)*1.4 + j + n;
        a += dot(cos(q)/S, vec2(0.5));
        n -= sin(q);
        S *= 1.3;
        j += 1.2;
    }
    fragColor = (a + 0.1)*vec4(2.5, 2.0, 4.0, 0.0) + a + a - d;
}
